import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const Account = () => {
  return (
    <div>
      <Header />
      <h1>Ваш профиль</h1>
      <p>Здесь будет информация о вашем профиле. Пока что данная страница не поддерживает функциональность входа, но в будущем здесь будет возможность редактировать информацию о профиле.</p>
      <Footer />
    </div>
  );
};

export default Account;
